	<style type="text/css">
		
		#pt {
  animation: point .7s infinite;
  fill:white;
  transform-origin: 50% 50%;
}

@keyframes point{
  50%{ opacity:0.5;
       transform: scale(0.5);
  }
}

#mid {
  animation: point .7s infinite;
  fill:white;
  transform-origin: 50% 50%;
  animation-delay: 4s;
}

.gr {
  animation: dip1 3s linear infinite;
  transform-origin: 50% 50%;
}

@keyframes dip1 {
  0%{}
  50% {}
  100%{transform: rotate(360deg)}
}

.sm {
  animation: dip2 3s linear infinite;
  transform-origin: 50% 50%;
}

@keyframes dip2 {
  0%{}
  50% {}
  100%{transform: rotate(-360deg)}
}

#lf {
  animation: point 2s infinite;
  fill:white;
  transform-origin: 50% 50%;
}

@keyframes point{
  50%{ opacity:0.5;
  }
}

#rt {
  animation: point 2s infinite;
  fill:white;
  transform-origin: 50% 50%;
  animation-delay: 3s;
}
	</style>
